@christinach 
I wonder whether it would make sense to leverage the prefix: all the newly created non-requestable SC location codes start with "sca". (Instead of hard-coding the locations.)

This is of interest also because SC is currently requesting the creation of additional non-requestable location codes. They will also start with "sca". If the prefix can be used for this, then we won't need to do more work for additional locations in this category later on.
